import './Getsupport.css';

export default function Getsupport() {
  const [state, setState] = useState('Madhya Pradesh');

  const handleStateChange = (e) => {
    setState(e.target.value);
  };
  
  const data = {
    "Madhya Pradesh": [
      { city: "Indore", url: "https://www.google.com.qa/maps/d/u/0/embed?mid=1zpKbwGNxYyulkhdn5vY6sV0d-UKSYuQ&ehbc=2E312F&noprof=1" },
      { city: "Betul", url: "https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d29613.722993833668!2d77.87978018241992!3d21.907033485159968!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x3bd6099355fd39f5%3A0xfcd7f3a44fc36322!2sBetul%2C%20Madhya%20Pradesh%20460001!5e0!3m2!1sen!2sin!4v1699392083089!5m2!1sen!2sin" },
