      { city: "Bhopal", url: "https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d234700.3459589449!2d77.2410772254802!3d23.199639467508252!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x397c428f8fd68fbd%3A0x2155716d572d4f8!2sBhopal%2C%20Madhya%20Pradesh!5e0!3m2!1sen!2sin!4v1699391868415!5m2!1sen!2sin" },
      { city: "Dewas", url: "https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d58779.40320495624!2d76.00134631713577!3d22.96080556209058!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x396317850c371de7%3A0x22947c209f24505!2sDewas%2C%20Madhya%20Pradesh!5e0!3m2!1sen!2sin!4v1699392211715!5m2!1sen!2sin" },
      { city: "Ratlam", url: "https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d58614.73049848669!2d75.0012460201098!3d23.33676982351622!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x3963fea373229b5b%3A0xcb0c22405de45a70!2sRatlam%2C%20Madhya%20Pradesh%20457001!5e0!3m2!1sen!2sin!4v1699392250675!5m2!1sen!2sin" },
      { city: "Gwalior", url: "https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d229085.1822214773!2d78.02608515520745!3d26.21436995560589!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x3976c5d1792291fb%3A0xff4fb56d65bc3adf!2sGwalior%2C%20Madhya%20Pradesh!5e0!3m2!1sen!2sin!4v1699392268157!5m2!1sen!2sin" },
