    ],
    "Maharastra": [
      { city: "Mumbai", url: "https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d241316.67292570192!2d72.71637142884188!3d19.08250200641916!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x3be7c6306644edc1%3A0x5da4ed8f8d648c69!2sMumbai%2C%20Maharashtra!5e0!3m2!1sen!2sin!4v1699393126793!5m2!1sen!2sin" },
      { city: "Pune", url: "https://www.example.com/pune" },
      { city: "Nagpur", url: "https://www.example.com/nagpur" },
      { city: "Nashik", url: "https://www.example.com/nashik" },
      { city: "Aurangabad", url: "https://www.example.com/aurangabad" },
      { city: "Solapur", url: "https://www.example.com/solapur" },
      { city: "Thane", url: "https://www.example.com/thane" }
    ],
    "Manipur": [
      { city: "Imphal", url: "https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d115893.8767706187!2d93.85400773289773!3d24.806283864796086!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x3749265bf16390db%3A0x19499aae263c5424!2sImphal%2C%20Manipur!5e0!3m2!1sen!2sin!4v1699393200554!5m2!1sen!2sin" },
      { city: "Thoubal", url: "https://www.example.com/thoubal" },
      { city: "Kakching", url: "https://www.example.com/kakching" },
      { city: "Bishnupur", url: "https://www.example.com/bishnupur" }
    ],
    "Goa": [
      { city: "Panaji", url: "https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d30761.145008318774!2d73.79228292248682!3d15.476731657479808!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x3bbfc0a93361ccd9%3A0xdd98120b24e5be61!2sPanaji%2C%20Goa!5e0!3m2!1sen!2sin!4v1699393271087!5m2!1sen!2sin" },
      { city: "Margao", url: "https://www.example.com/margao" },
      { city: "Mapusa", url: "https://www.example.com/mapusa" },
      { city: "Ponda", url: "https://www.example.com/ponda" }
    ],
    "Assam": [
      { city: "Guwahati", url: "https://www.example.com/guwahati" },
      { city: "Silchar", url: "https://www.example.com/silchar" },
      { city: "Dibrugarh", url: "https://www.example.com/dibrugarh" },
      { city: "Jorhat", url: "https://www.example.com/jorhat" },
      { city: "Nagaon", url: "https://www.example.com/nagaon" }
    ],
    "Sikkim": [
      { city: "Gangtok", url: "https://www.example.com/gangtok" },
      { city: "Namchi", url: "https://www.example.com/namchi" },
      { city: "Mangan", url: "https://www.example.com/mangan" },
      { city: "Gyalshing", url: "https://www.example.com/gyalshing" },
      { city: "Rangpo", url: "https://www.example.com/rangpo" }
    ]
  };
  

  return (
    <div>
      <div className='top'>
        <h1 className='logos1'>Our Centers in</h1>
        <div className='selectContainer'>
          <select className='dropdown' onChange={handleStateChange} value={state}>
            <option value="Madhya Pradesh">Madhya Pradesh</option>
            <option value="Maharastra">Maharastra</option>                
            <option value="Manipur">Manipur</option>
            <option value="Goa">Goa</option>
            <option value="Assam">Assam</option>
            <option value="Sikkim">Sikkim</option>
          </select>
        </div>
      </div>
      <div className='cardpositioner'>
        {data[state].map((item, index) => (
          <div key={index} className='cards'>
            <div className='cardname'><h4>{item.city}</h4></div>
            <div className='cardmap'>
              <iframe
                title={item.city}
                src={item.url}
                width="600"
                height="450"
                style={{ border: "0" }}
                allowFullScreen=""
                loading="lazy"
                referrerPolicy="no-referrer-when-downgrade"
              ></iframe>
            </div>
          </div>
        ))}
      </div>
      
    </div>
  );
}
